import React from 'react';
import {Link} from "react-router-dom";
import listIcon from '../images/icons/list-icon.svg';
import ProfileIcon from '../images/icons/profile-icon.svg';
import loginIcon from '../images/icons/login-icon.svg';
import {iconSizeMin} from '../constants/constants'

export default function Nav(props) {
    return (
        <div className='nav'>
            <Link to='/'>
                <span>Hoftun Utvikling</span>
            </Link>
            <Link to='/Cabins'>
                <img 
                    src={listIcon}
                    className='nav__icon'
                    alt='List icon'
                    height={iconSizeMin}
                    width={iconSizeMin}
                />
            </Link>
            <Link to='/ContactPage'>
                <img 
                    src={ProfileIcon} 
                    className='nav__icon' 
                    alt='Profile icon' 
                    height={iconSizeMin}
                    width={iconSizeMin}
                />
            </Link>
            <Link to='/Login'>
                <img 
                    src={loginIcon} 
                    className='nav__icon' 
                    alt='Login icon' 
                    height={iconSizeMin}
                    width={iconSizeMin}
                />
            </Link>
        </div>
    )
}
